// this is where json file data from porjects comes in. Reusable component// dont forget to import it
// render six instances of projectgallery projects
import React from "react";
import Layout from "../components/Layout";
import projectData from "../details.json";
import Card from "react-bootstrap/Card";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";
// import {Link} from  "react-router-dom"
import "../pages/Projects.css";

const Projects = () => {
  console.log(typeof projectData);
  return (
    <div>
      <Layout>
        <Row xs={1} md={2} className="g-4">
          {projectData.map((project) => (
            <Col>
              <Card className="projectsCards" key={project.id}>
                <Card.Img
                  className="projectsImgEl"
                  variant="top"
                  src={process.env.PUBLIC_URL + "/" + project.projectImage}
                  alt={project.title}
                />
              </Card>
            </Col>
          ))}
        </Row>
      </Layout>
    </div>
  );
};

export default Projects;

